import React from 'react';

import { Grid } from '@material-ui/core';

import Nav from '../../components/Navigation/Nav';
import Info from '../../components/Contact/Info';

const Contact = () => {


    return (
        <Grid container>

            <Grid style={{height: 70}} item xs={12}>

                <Nav />

            </Grid>
            <Grid item xs={12}>

                <Info />

            </Grid>

        </Grid>
    );
};

export default Contact;
